import 'package:equatable/equatable.dart';

class ResultSet extends Equatable {
  final int? count;
  final String? competitions;
  final String? first;
  final String? last;
  final int? played;

  const ResultSet({
    this.count,
    this.competitions,
    this.first,
    this.last,
    this.played,
  });

  factory ResultSet.(
      Map<String, dynamic> json) {
    return ResultSet(
      count: json['count'] as int?,
      competitions: json['competitions'] as String?,
      first: json['first'] as String?,
      last: json['last'] as String?,
      played: json['played'] as int?,
    );
  }

  Map<String, dynamic>
      () {
    return {
      'count': count,
      'competitions': competitions,
      'first': first,
      'last': last,
      'played': played,
    };
  }

  @override
  List<Object?> get props => [count, competitions, first, last, played];
}
